function App() {

  const test = async() => {
    const result = await getCommonBoard(null);
    console.log(result,"result====")
  }

  useEffect(()=>{
    test()
  })
  return (

    <div className="App">
      <Home/>
      test
    </div>
  );
}

export default App;
